SEVENTEEN telah dikonfirmasi akan tampil dalam program musik populer di Jepang yang bertajuk ‘Music Station’. SEVENTEEN telah dijadwalkan akan tampil di program ‘Music Station’ pada 11 September 2020 pekan mendatang. Melalui acara musik Jepang ini, SEVENTEEN akan membawakan lagu berbahasa Jepang terbaru mereka yang berjudul ’24H’
.
Video musik untuk lagu ’24H’ ini sudah dirilis oleh SEVENTEEN pada 24 Agustus lalu, menjelang perilisan mini album terbaru mereka di Jepang pada 9 September mendatang. Saat dirilis, single ’24H’ ini langsung memuncaki chart Line Music di Jepang, membuktikan popularitas mereka yang luar biasa di sana. Episode ‘Music Station’ yang dihadiri oleh anggota SEVENTEEN ini akan ditayangkan pada 11 September pukul 21.00 KST yang akan datang
.
